libs.content:
find_library(sdl_library 
	names sdl libsdl
	paths $env{ld_library_path} $env{library_path} $env{lib}
)

find_library(vorbis_library 
	names vorbis libvorbis
	hints
	no_default_path
	no_cmake_environment_path
	no_cmake_system_path
	no_system_environment_path
	no_cmake_path
	$env{vorbisdir}
	$env{vorbis_path}
	path_suffixes lib lib64 win32/vorbis_dynamic_release "win32/vs6/x64/release" "win32/vs6/win32/release"
	paths ${vorbis_search_paths}
)

